import { Marker, Popup } from 'react-leaflet';

function MarkerPoint(props) {

  const [image, setImage] = useState([])

  const latlng = [props.lat, props.lng]

  useEffect(() => {
    fetch("http://localhost:3001/api/v1/points")
    .then(res => res.json())
    .then((res) => setMarkers(res))
  }, [])


  return (
    <Marker position={latlng} id={props.id}>
        <Popup>
          <h1>{props.date}</h1>
          <p>{props.filename}</p>
          <img src={props.filename} alt="sick pic"/>
          <p>{props.notes}</p>
        </Popup>
    </Marker>
  );
}

export default MarkerPoint;
